import React from 'react';

const Menu = () => {
  return (
    <nav className="flex items-center justify-between px-6 py-4 bg-gray-800">
    <div className="flex items-center justify-between">
      <img src=".\assets\img\logo-restaurant.png" alt="Logo" className="h-8 w-auto mr-4" />
      <div className="flex space-x-6 text-white">
        <a href="#" className="hover:text-gray-400">Home</a>
        <a href="#" className="hover:text-gray-400">Events</a>
        <a href="#" className="hover:text-gray-400">Gallery</a>
        <a href="#" className="hover:text-gray-400">About</a>
        <a href="#" className="hover:text-gray-400">Contact</a>
      </div>
    </div>
    <button className="bg-orange-500 hover:bg-orange-600 text-white font-bold py-2 px-4 rounded">Book a Table</button>
  </nav>
  );
};

export default Menu;
